    <div class="mask" style="background-color: rgba(0, 0, 0, 0.6);">
      <div class="d-flex justify-content-center align-items-center h-100">
        <div class="text-white">
          <h1 class="mb-3">Todos os Projetos integradores dos ETE'Sconectados em um só lugar!</h1>
          <p class="mb-3">O Repositório conect ETE PE é uma base de dados online que objetiva reunir, de forma organizada e acessível, a produção documental das ETE'S de toda a RMR, com ituito de torná-la acessível aos pesquisadores e ao grupo público nacional e internacional</p>
          <a data-mdb-ripple-init class="btn btn-outline-light btn-lg" href="#!" role="button">Saiba mais...</a>
          <p></p>
        </div>
      </div>
    </div>
  </div>

      
    </>
  );
}

export default Paragrafos;
